import React from 'react';
import { Card, CardContent, Typography, Grid, Avatar, Box } from '@mui/material';

const RUNE_STYLE_NAMES = {
  8100: 'Domination',
  8300: 'Inspiration',
  8000: 'Precision',
  8400: 'Resolve',
  8200: 'Sorcery',
};

const RUNE_PERK_NAMES = {
  8112: 'Electrocute',
  8124: 'Predator',
  8128: 'DarkHarvest',
  9923: 'HailOfBlades',
  8351: 'GlacialAugment',
  8360: 'UnsealedSpellbook',
  8005: 'PressTheAttack',
  8008: 'LethalTempo',
  8021: 'FleetFootwork',
  8010: 'Conqueror',
  8437: 'GraspOfTheUndying',
  8439: 'Aftershock',
  8465: 'Guardian',
  8214: 'SummonAery',
  8229: 'ArcaneComet',
  8230: 'PhaseRush',
};

function Match({ match }) {
  if (!match) return null;

  const {
    champion,
    win,
    items = [],
    kills,
    deaths,
    assists,
    gameDuration,
    summonerSpells = [],
    runes = [],
    participants = [],
    version = "14.21.1",
  } = match;

  const matchOutcome = win ? 'Victory' : 'Defeat';
  const outcomeColor = win ? 'success.main' : 'error.main';

  const team1 = participants.slice(0, 5);
  const team2 = participants.slice(5, 10);

  const renderImages = (urls) => (
    urls.map((url, index) => (
      <Avatar
        key={index}
        src={url}
        sx={{ width: 30, height: 30, marginRight: 1 }}
        alt="item"
      />
    ))
  );

  const itemImages = renderImages(items.map((itemId) => 
    `https://ddragon.leagueoflegends.com/cdn/${version}/img/item/${itemId}.png`
  ));

  const spellImages = renderImages(summonerSpells.map((spellName) => 
    `https://ddragon.leagueoflegends.com/cdn/${version}/img/spell/${spellName}.png`
  ));

  const runeImages = runes.map((runeStyle, index) => {
    const styleName = RUNE_STYLE_NAMES[runeStyle.style] || 'Unknown';
    const perkName = RUNE_PERK_NAMES[runeStyle.selections[0]?.perk] || 'Unknown';
    return (
      <Avatar
        key={index}
        src={`https://ddragon.leagueoflegends.com/cdn/img/perk-images/Styles/${styleName}/${perkName}/${perkName}.png`}
        sx={{ width: 30, height: 30, marginRight: 1 }}
        alt={styleName}
      />
    );
  });

  const renderTeam = (team) => (
    team.map((participant, index) => (
      <Box key={index} sx={{ display: 'flex', alignItems: 'center', marginBottom: 1 }}>
        <Avatar
          src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/champion/${participant.championName}.png`}
          sx={{ width: 25, height: 25, marginRight: 1 }}
          alt={participant.championName}
        />
        <Typography variant="body2" color="text.secondary">
          {participant.summonerName}
        </Typography>
      </Box>
    ))
  );

  return (
    <Card variant="outlined" sx={{ backgroundColor: '#1e293b', color: '#f0f0f0', mb: 2, p: 2 }}>
      <CardContent>
        <Grid container spacing={2}>
          <Grid item xs={3}>
            <Avatar
              src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/champion/${champion}.png`}
              alt={champion}
              sx={{ width: 64, height: 64 }}
            />
          </Grid>
          <Grid item xs={9}>
            <Typography variant="h6" color={outcomeColor} fontWeight="bold">
              {matchOutcome}
            </Typography>
            <Typography variant="body1">
              {kills}/{deaths}/{assists} K/D/A
            </Typography>
            <Typography variant="body2" color="text.secondary">Duration: {gameDuration}</Typography>
          </Grid>
          <Grid item xs={6}>
            <Typography variant="subtitle1" color="text.secondary">Summoner Spells:</Typography>
            <Box sx={{ display: 'flex', flexDirection: 'row', mt: 1 }}>
              {spellImages}
            </Box>
          </Grid>
          <Grid item xs={6}>
            <Typography variant="subtitle1" color="text.secondary">Items:</Typography>
            <Box sx={{ display: 'flex', flexDirection: 'row', mt: 1 }}>
              {itemImages}
            </Box>
          </Grid>
          <Grid item xs={12}>
            <Typography variant="subtitle1" color="text.secondary">Runes:</Typography>
            <Box sx={{ display: 'flex', flexDirection: 'row', mt: 1 }}>
              {runeImages}
            </Box>
          </Grid>
          <Grid item xs={6}>
            <Typography variant="subtitle1" color="text.secondary">Team 1</Typography>
            {renderTeam(team1)}
          </Grid>
          <Grid item xs={6}>
            <Typography variant="subtitle1" color="text.secondary">Team 2</Typography>
            {renderTeam(team2)}
          </Grid>
        </Grid>
      </CardContent>
    </Card>
  );
}

export default Match;
